INSERT INTO public.books VALUES ('39a430b3-9bfd-4d3d-a848-2b450f4cfe13', 'Covenant Wealth: Unlocking God‚Äôs Divine Economy through Tithes, Offerings & First Fruits', 'Dr C Wiseman', '<p><span class="my-custom-class" style="color: rgb(0, 0, 0);"><strong>Are you tired of giving‚Ä¶ but still struggling?</strong><br>You tithe. You sow. You pray. Yet breakthrough seems delayed, and your finances feel stuck in a cycle of lack, fear, and frustration.</span></p><p><span class="my-custom-class" style="color: rgb(0, 0, 0);"><strong>You are not alone.</strong><br>Many believers live under open heavens but still experience closed doors‚Äîbecause they don‚Äôt understand&nbsp;<strong>God‚Äôs covenant economy.</strong></span></p><p><span class="my-custom-class" style="color: rgb(0, 0, 0);">If you‚Äôve ever wondered:</span></p><ul><li><p><span class="my-custom-class" style="color: rgb(0, 0, 0);">‚ÄúWhy am I still broke when I‚Äôm faithful?‚Äù</span></p></li><li><p><span class="my-custom-class" style="color: rgb(0, 0, 0);">‚ÄúWhere is the harvest from my giving?‚Äù</span></p></li><li><p><span class="my-custom-class" style="color: rgb(0, 0, 0);">‚ÄúIs there something I‚Äôm missing?‚Äù</span></p></li></ul><p><span class="my-custom-class" style="color: rgb(0, 0, 0);"><strong>This book is your answer.</strong></span></p><hr><p><span class="my-custom-class" style="color: rgb(0, 0, 0);">In&nbsp;<em>Covenant Wealth</em>, Master Prophet Dr. Climate Wiseman shares the prophetic revelation, personal testimonies, and biblical blueprint that took him from homelessness and a 25p tithe‚Ä¶ to global abundance and supernatural provision.</span></p><p><span class="my-custom-class" style="color: rgb(0, 0, 0);"><strong>This is more than a book‚Äîit‚Äôs a divine reset for your finances.</strong><br>You‚Äôll discover:</span></p><p><span class="my-custom-class" style="color: rgb(0, 0, 0);">‚úÖ What the tithe really is‚Äîand how to activate its protection and provision<br>‚úÖ Why offerings must speak‚Äîand how to sow for maximum return<br>‚úÖ The power of First Fruits‚Äîand how one act of obedience can change your entire year<br>‚úÖ How to avoid financial delay by breaking common giving mistakes<br>‚úÖ How to live in the&nbsp;<em>covenant cycle</em>&nbsp;of Tithe ‚Üí Offering ‚Üí First Fruit ‚Üí Harvest ‚Üí Repeat</span></p><hr><h3><span class="my-custom-class" style="color: rgb(0, 0, 0);"><strong>This book is for you if:</strong></span></h3><ul><li><p><span class="my-custom-class" style="color: rgb(0, 0, 0);">You tithe, but still live paycheck to paycheck</span></p></li><li><p><span class="my-custom-class" style="color: rgb(0, 0, 0);">You want to sow prophetically, but don‚Äôt know how</span></p></li><li><p><span class="my-custom-class" style="color: rgb(0, 0, 0);">You desire financial breakthrough without compromising your faith</span></p></li><li><p><span class="my-custom-class" style="color: rgb(0, 0, 0);">You are a pastor, leader, or giver ready to teach or live the truth boldly</span></p></li><li><p><span class="my-custom-class" style="color: rgb(0, 0, 0);">You‚Äôve been stuck in cycles of struggle and want to unlock lasting overflow</span></p></li></ul><hr><p><span class="my-custom-class" style="color: rgb(0, 0, 0);"><strong>You were never created to live in survival. You were born for covenant wealth.</strong><br>It‚Äôs time to align your giving with God‚Äôs divine economy‚Äîand watch the heavens open over your life.</span></p><h3><span class="my-custom-class" style="color: rgb(0, 0, 0);"><strong>üìñ&nbsp;<em>Your breakthrough is not delayed‚Äîyour understanding is about to catch up.</em></strong></span></h3><p><span class="my-custom-class" style="color: rgb(0, 0, 0);"><strong>The blessing you‚Äôve been longing for is one covenant decision away. Are you ready to walk in it?</strong></span></p>', '/uploads/1754453446477-kgg86a.png', '/uploads/pdfs/1754453468245-7a2lh9.pdf', 5.00, 1, true, 'free', '2025-08-06 04:11:16.890922', '2025-08-06 04:11:16.890922', 'Discover powerful insights and practical strategies that will transform your personal and professional life. This comprehensive guide combines timeless wisdom with modern research to help you achieve lasting success and fulfillment.', 'A renowned author and thought leader in personal development, bringing decades of experience in helping individuals and organizations achieve their potential.', 'Premium Publishing', 2020, 250, 'English', NULL, 'Self-Help', '{Introduction,"Foundation Principles","Practical Applications","Advanced Strategies","Implementation Guide",Conclusion}', '{"Develop a growth mindset","Build consistent daily practices","Focus on long-term thinking","Create meaningful relationships"}', '{"Enhance personal effectiveness","Develop leadership skills","Improve decision-making abilities","Build lasting success habits"}', 'Intermediate', 4, '{self-help,personal-growth,success,motivation}', '{"Readers Choice Award","Personal Development Bestseller"}', 1, NULL, 5, NULL, NULL, NULL, 1048576, 0, NULL);
INSERT INTO public.books VALUES ('b9ad5b9d-2437-4ed8-be2b-6bb517ecd1aa', 'Multiply the Vision: A Practical Guide to Equipping Leaders Who Make Disciples', 'Dr C Wiseman', '<p><strong>Are you ready to move beyond maintenance into true multiplication?</strong></p><p><strong>The Kingdom Temple isn‚Äôt called to be just another gathering place.</strong><br>It is a&nbsp;<em>spiritual stronghold</em>&nbsp;where captives are set free and disciples are planted to flourish.</p><p>But this vision can‚Äôt be fulfilled by passive spectators or reluctant helpers.<br>It demands&nbsp;<em>committed, equipped, and on-fire leaders</em>&nbsp;who know how to reproduce themselves over and over.</p><p>This manual is your&nbsp;<strong>blueprint</strong>&nbsp;for that kind of leadership.<br>It will challenge you, train you, and transform you‚Äîmoving you from simply serving to truly&nbsp;<strong>multiplying</strong>.</p><p>Inside you‚Äôll discover:</p><ul><li><p>How to conquer fear, laziness, offense, and hidden sin</p></li><li><p>How to invite, disciple, and train others to lead</p></li><li><p>How to build accountability, sustain personal revival, and prioritize God‚Äôs mission</p></li><li><p>How to create a culture of discipleship that reproduces for generations</p></li></ul><p>If you‚Äôre tired of watching church growth stall at programs and events‚Ä¶<br>If you‚Äôre burdened to see real lives changed, families restored, and your city impacted‚Ä¶<br>If you‚Äôre willing to pay the price to become the kind of leader God can trust with souls‚Ä¶</p><p><strong>This book is your call to arms.</strong></p><p>It‚Äôs time to take ownership.<br>It‚Äôs time to make disciples who make disciples.<br>It‚Äôs time to see The Kingdom Temple become everything God intended:<br>A place where the captives are set free, and all disciples are planted to flourish.</p><p><strong>Answer the call. Multiply the mission. Change the world.</strong></p>', '/uploads/1754453929800-msice.png', '/uploads/pdfs/1754453915874-oqutoa.pdf', 4.00, 1, true, 'free', '2025-08-06 04:19:33.286573', '2025-08-06 04:19:33.286573', 'Discover powerful insights and practical strategies that will transform your personal and professional life. This comprehensive guide combines timeless wisdom with modern research to help you achieve lasting success and fulfillment.', 'A renowned author and thought leader in personal development, bringing decades of experience in helping individuals and organizations achieve their potential.', 'Premium Publishing', 2020, 250, 'English', NULL, 'Self-Help', '{Introduction,"Foundation Principles","Practical Applications","Advanced Strategies","Implementation Guide",Conclusion}', '{"Develop a growth mindset","Build consistent daily practices","Focus on long-term thinking","Create meaningful relationships"}', '{"Enhance personal effectiveness","Develop leadership skills","Improve decision-making abilities","Build lasting success habits"}', 'Intermediate', 4, '{self-help,personal-growth,success,motivation}', '{"Readers Choice Award","Personal Development Bestseller"}', 1, NULL, 5, NULL, NULL, NULL, 1048576, 0, NULL);
INSERT INTO public.books VALUES ('b3ff71d5-5637-4f9c-9eac-520afa80786f', '30 Days to Overcome Spiritual Blockages: Break Invisible Resistance, Dismantle Demonic Roadblocks, and Release Divine Flow', 'Dr C Wiseman', '<p><strong>Something unseen is standing in your way‚Äîand you can feel it.</strong></p><p>You‚Äôve prayed. You‚Äôve fasted. You‚Äôve tried everything. Yet the doors won‚Äôt open, your progress is delayed, and breakthrough feels just out of reach. It‚Äôs not your imagination. You‚Äôre up against spiritual blockages‚Äî<strong>invisible barriers designed to keep you stuck.</strong></p><p>If you‚Äôre weary of frustration and ready for freedom, this book is your prophetic lifeline.</p><p><strong>30 Days to Overcome Spiritual Blockages</strong>&nbsp;is a powerful, step-by-step journey designed to help you identify, confront, and dismantle the spiritual resistance holding you back. Whether you‚Äôre battling delay, confusion, spiritual heaviness, or a sense of unexplainable oppression, this 30-day guide gives you the&nbsp;<strong>tools to break through and flow again.</strong></p><p>You‚Äôll uncover:</p><p>‚úÖ Hidden emotional wounds acting as spiritual entry points<br>‚úÖ Demonic checkpoints stationed at your breakthrough moments<br>‚úÖ Cursed objects, soul ties, and atmospheres blocking your peace<br>‚úÖ How to use oil, fasting, prophetic actions, and strategic declarations<br>‚úÖ Daily rituals to restore divine momentum, clarity, and alignment</p><p>Each day includes prophetic teaching, journaling prompts, real testimonies, targeted declarations, and warfare prayer points that will help you regain spiritual control and release divine flow.</p><p><strong>This book is for you if:</strong></p><ul><li><p>You feel spiritually stuck, heavy, or delayed</p></li><li><p>You‚Äôve experienced sudden losses, rejection, or repeated near-misses</p></li><li><p>You battle confusion, anxiety, or constant spiritual fatigue</p></li><li><p>You want to restore consistent peace, direction, and supernatural favor</p></li><li><p>You‚Äôre ready to step into a life of power, progress, and prophetic flow</p></li></ul><p>You don‚Äôt have to keep fighting blind.<br>You don‚Äôt have to keep wondering why nothing‚Äôs moving.</p><p><strong>The peace, clarity, and breakthrough you‚Äôve been praying for is just 30 days away.</strong><br><strong>Are you ready to embrace it?</strong></p>', '/uploads/1754455646217-rzvup.png', '/uploads/pdfs/1754455632785-zprlp.pdf', 5.00, 0, false, 'free', '2025-08-06 04:48:48.453352', '2025-08-06 04:48:48.453352', 'Discover powerful insights and practical strategies that will transform your personal and professional life. This comprehensive guide combines timeless wisdom with modern research to help you achieve lasting success and fulfillment.', 'A renowned author and thought leader in personal development, bringing decades of experience in helping individuals and organizations achieve their potential.', 'Premium Publishing', 2020, 250, 'English', NULL, 'Self-Help', '{Introduction,"Foundation Principles","Practical Applications","Advanced Strategies","Implementation Guide",Conclusion}', '{"Develop a growth mindset","Build consistent daily practices","Focus on long-term thinking","Create meaningful relationships"}', '{"Enhance personal effectiveness","Develop leadership skills","Improve decision-making abilities","Build lasting success habits"}', 'Intermediate', 4, '{self-help,personal-growth,success,motivation}', '{"Readers Choice Award","Personal Development Bestseller"}', 0, NULL, 5, NULL, NULL, NULL, 1048576, 0, NULL);
INSERT INTO public.books VALUES ('e147f9bd-67e4-4e09-b923-049ed63a0095', '30 Days to Overcome Family Dysfunction: Healing From the Pain of Broken Roles, Toxic Patterns, and Divided Homes', 'Dr C Wiseman', '<p><strong>What do you do when the people who were supposed to love you became the source of your deepest wounds?</strong></p><p>The silence. The screaming. The secrets.<br>You‚Äôve tried to hold the family together. You‚Äôve tried to pray it away, reason it out, or just survive another day. But behind closed doors, the dysfunction keeps growing‚Äîand it‚Äôs taking a toll on your mind, your peace, and your sense of worth.</p><p>Whether you come from a broken marriage, a controlling parent, a hostile stepfamily, or a generational mess that no one wants to talk about‚Äî<strong>this book was written for you.</strong></p><p><strong>In just 30 days, you can begin a healing journey that will:</strong></p><ul><li><p>Break toxic emotional patterns passed down through generations</p></li><li><p>Help you set boundaries without losing your heart</p></li><li><p>Heal your identity from parental wounds and childhood chaos</p></li><li><p>Restore clarity where confusion once reigned</p></li><li><p>Equip you to build a peaceful home‚Äîeven if others stay toxic</p></li><li><p>Free you from guilt, fear, and silent suffering</p></li></ul><p><strong>This book doesn‚Äôt just talk about dysfunction‚Äîit walks you out of it.</strong></p><p>Every chapter includes real-life stories, prophetic insights, journal prompts, daily action steps, prayers, and declarations that confront deep-rooted pain with spiritual truth and practical strategies. Written with compassion and clarity,&nbsp;<em>30 Days to Overcome Family Dysfunction</em>&nbsp;gives you the structure and support you need to reset your life‚Äîwithout pretending, suppressing, or enabling toxic behavior any longer.</p><p><strong>This book is for you if you:</strong></p><ul><li><p>Grew up in a home where love was conditional, chaotic, or absent</p></li><li><p>Are raising children but afraid of repeating the same mistakes</p></li><li><p>Feel like the ‚Äúblack sheep‚Äù or emotional caretaker in your family</p></li><li><p>Struggle with guilt, anger, or people-pleasing because of family trauma</p></li><li><p>Want to change the future for the next generation‚Äîstarting with yourself</p></li></ul><p><strong>The peace you‚Äôve been longing for is just 30 days away. Are you ready to embrace it?</strong></p>', '/uploads/1754455767227-ptcfl.png', '/uploads/pdfs/1754455757797-ta3v7.pdf', 4.00, 0, false, 'free', '2025-08-06 04:50:15.229619', '2025-08-06 04:50:15.229619', 'Discover powerful insights and practical strategies that will transform your personal and professional life. This comprehensive guide combines timeless wisdom with modern research to help you achieve lasting success and fulfillment.', 'A renowned author and thought leader in personal development, bringing decades of experience in helping individuals and organizations achieve their potential.', 'Premium Publishing', 2020, 250, 'English', NULL, 'Self-Help', '{Introduction,"Foundation Principles","Practical Applications","Advanced Strategies","Implementation Guide",Conclusion}', '{"Develop a growth mindset","Build consistent daily practices","Focus on long-term thinking","Create meaningful relationships"}', '{"Enhance personal effectiveness","Develop leadership skills","Improve decision-making abilities","Build lasting success habits"}', 'Intermediate', 4, '{self-help,personal-growth,success,motivation}', '{"Readers Choice Award","Personal Development Bestseller"}', 0, NULL, 5, NULL, NULL, NULL, 1048576, 0, NULL);
INSERT INTO public.books VALUES ('b482f62a-165e-4379-a3eb-099efd4949f6', '30 Days to Break the Curse of Late Marriage: Your Step By Step Guide To Unlock Your God-Ordained Relationship Season', 'Dr C Wiseman', '<p><strong>You‚Äôve waited. You‚Äôve prayed. But nothing has changed‚Äîuntil now.</strong></p><p>If you‚Äôve ever felt like love has passed you by‚Ä¶<br>If you‚Äôve watched others step into marriage while you silently wonder, ‚ÄúWhat‚Äôs wrong with me?‚Äù‚Ä¶<br>If your heart aches every time another year goes by and your prayers seem unanswered‚Ä¶</p><p><strong>You are not alone‚Äîand this book was written for you.</strong></p><p><em>30 Days to Break the Curse of Late Marriage</em>&nbsp;is a powerful, step-by-step deliverance manual designed to expose and break every spiritual, emotional, and generational barrier blocking your God-ordained relationship season.</p><p>Through proven prophetic strategies, daily healing exercises, and intentional prayers, Bishop Climate Wiseman guides you through the inner transformation that attracts divine alignment.</p><p>You won‚Äôt just learn how to wait‚Äîyou‚Äôll learn how to&nbsp;<strong>break through</strong>.</p><h3><strong>In 30 Days, You Will:</strong></h3><ul><li><p>Uproot invisible curses causing relationship delays</p></li><li><p>Heal emotional wounds that sabotage divine connections</p></li><li><p>Identify and reject counterfeit relationships</p></li><li><p>Pray strategically for your future spouse</p></li><li><p>Rediscover your identity and worth</p></li><li><p>Enter into a season of divine exposure, favor, and covenant fulfillment</p></li></ul><p>This book is not about wishful thinking‚Äîit‚Äôs about&nbsp;<strong>warfare</strong>,&nbsp;<strong>wisdom</strong>, and&nbsp;<strong>winning</strong>&nbsp;in your relationship destiny.</p><hr><h3><strong>This Book Is For You If:</strong></h3><ul><li><p>You‚Äôve experienced repeated heartbreak or betrayal</p></li><li><p>You feel overlooked or invisible despite your prayers</p></li><li><p>There is a history of late marriage or singleness in your family</p></li><li><p>You‚Äôre tired of surface solutions and are ready for spiritual depth</p></li><li><p>You desire to marry right, marry well, and marry on time</p></li></ul><p><strong>You‚Äôre not delayed‚Äîyou‚Äôre being prepared. And this is your time.</strong></p><p><strong>The breakthrough you‚Äôve been waiting for is just 30 days away.</strong><br><strong>Are you ready to embrace it?</strong></p>', '/uploads/1754455927265-l74pyc.png', '/uploads/pdfs/1754455921052-vkihvn.pdf', 4.00, 0, false, 'free', '2025-08-06 04:53:01.644062', '2025-08-06 04:53:01.644062', 'Discover powerful insights and practical strategies that will transform your personal and professional life. This comprehensive guide combines timeless wisdom with modern research to help you achieve lasting success and fulfillment.', 'A renowned author and thought leader in personal development, bringing decades of experience in helping individuals and organizations achieve their potential.', 'Premium Publishing', 2020, 250, 'English', NULL, 'Self-Help', '{Introduction,"Foundation Principles","Practical Applications","Advanced Strategies","Implementation Guide",Conclusion}', '{"Develop a growth mindset","Build consistent daily practices","Focus on long-term thinking","Create meaningful relationships"}', '{"Enhance personal effectiveness","Develop leadership skills","Improve decision-making abilities","Build lasting success habits"}', 'Intermediate', 4, '{self-help,personal-growth,success,motivation}', '{"Readers Choice Award","Personal Development Bestseller"}', 0, NULL, 5, NULL, NULL, NULL, 1048576, 0, NULL);
