INSERT INTO public.books VALUES ('deba8249-6ec8-4771-adc4-aa450387bd1a', '30 Days to Dismantle Evil Altars: Your Step-By-Step Guide To Tear Down Spiritual Structures Fighting Your Life', 'Dr C Wiseman', '<p><strong>Are you tired of feeling stuck, overwhelmed, and weighed down by invisible forces you can‚Äôt control?</strong></p><p>You‚Äôve tried everything, but the stress, fear, and confusion still linger. The battles in your life seem unending, and no matter how hard you fight, victory feels out of reach. If this sounds familiar, it‚Äôs time for a&nbsp;<strong>radical transformation</strong>.</p><p>This book is not just a guide‚Äîit‚Äôs your pathway to freedom. It‚Äôs designed to help you&nbsp;<strong>identify, dismantle, and remove</strong>the spiritual strongholds that have been blocking your peace, success, and joy. Through&nbsp;<strong>30 powerful days</strong>, you‚Äôll take practical, actionable steps that will not only free your spirit but also bring&nbsp;<strong>lasting emotional healing</strong>&nbsp;and&nbsp;<strong>inner peace</strong>.</p><p><strong>Inside this book, you‚Äôll discover:</strong></p><ul><li><p>How to recognize the&nbsp;<strong>hidden altars</strong>&nbsp;and negative spiritual structures that have been controlling your life.</p></li><li><p>Step-by-step guidance on how to&nbsp;<strong>tear them down</strong>and replace them with altars of freedom, worship, and divine authority.</p></li><li><p><strong>Emotional healing</strong>&nbsp;strategies that will restore your peace, clarity, and joy.</p></li><li><p>Proven methods to&nbsp;<strong>walk in spiritual authority</strong>, and maintain your breakthrough, so the enemy can‚Äôt regain a foothold in your life.</p></li></ul><hr><h3><strong>This book is for you if:</strong></h3><ul><li><p>You feel like you‚Äôre trapped in cycles of&nbsp;<strong>stress</strong>,&nbsp;<strong>fear</strong>, or&nbsp;<strong>hopelessness</strong>.</p></li><li><p>You‚Äôve been struggling to find&nbsp;<strong>lasting peace</strong>&nbsp;and&nbsp;<strong>clarity</strong>&nbsp;in your life.</p></li><li><p>You sense that&nbsp;<strong>something spiritual</strong>&nbsp;is blocking your success and happiness.</p></li><li><p>You‚Äôre ready to experience&nbsp;<strong>freedom</strong>&nbsp;and&nbsp;<strong>breakthrough</strong>&nbsp;in all areas of your life.</p></li></ul><hr><p>In just&nbsp;<strong>30 days</strong>, you can&nbsp;<strong>tear down the spiritual walls</strong>holding you back and step into the life you were meant to live. This book is written with&nbsp;<strong>understanding</strong>,&nbsp;<strong>compassion</strong>, and&nbsp;<strong>practical wisdom</strong>, guiding you step-by-step to total freedom.</p><p>The peace you‚Äôve been longing for is just 30 days away‚Äî<strong>are you ready to embrace it</strong>?</p><hr><p><strong>Take the first step toward your breakthrough today.</strong></p>', '/uploads/1754454150690-j5ycd2.png', '/uploads/pdfs/1754454138199-mlvw7.pdf', 5.00, 0, true, 'free', '2025-08-06 04:23:16.463065', '2025-08-06 04:23:16.463065', 'Discover powerful insights and practical strategies that will transform your personal and professional life. This comprehensive guide combines timeless wisdom with modern research to help you achieve lasting success and fulfillment.', 'A renowned author and thought leader in personal development, bringing decades of experience in helping individuals and organizations achieve their potential.', 'Premium Publishing', 2020, 250, 'English', NULL, 'Self-Help', '{Introduction,"Foundation Principles","Practical Applications","Advanced Strategies","Implementation Guide",Conclusion}', '{"Develop a growth mindset","Build consistent daily practices","Focus on long-term thinking","Create meaningful relationships"}', '{"Enhance personal effectiveness","Develop leadership skills","Improve decision-making abilities","Build lasting success habits"}', 'Intermediate', 4, '{self-help,personal-growth,success,motivation}', '{"Readers Choice Award","Personal Development Bestseller"}', 0, NULL, 5, NULL, NULL, NULL, 1048576, 0, NULL);
INSERT INTO public.books VALUES ('82f9671f-5e8c-41dc-a8b0-22f1852e8532', 'How to Build a Powerful Home Altar That Speaks, Protects & Releases Heaven‚Äôs Power in Your Daily Life', 'Dr C Wiseman', '<p>You were never meant to live in a powerless house.</p><p>In the battles of life‚Äîwhether they show up as delays, strange sicknesses, rebellious children, financial limitation, or spiritual confusion‚ÄîGod never intended for you to fight empty-handed. He designed a system, both ancient and prophetic, where Heaven responds to earth through the power of an altar.</p><p>The&nbsp;<strong>home altar</strong>&nbsp;is not just a piece of furniture or a sacred corner‚Äîit‚Äôs a spiritual technology. A divine access point. A place where your sacrifices speak louder than your enemies‚Äô accusations. A prophetic gate where heaven meets your household and where fire is kindled daily to protect, direct, and empower you.</p><p>In church, there is a central altar where corporate power is released. But what happens when the warfare follows you home? When you feel spiritually attacked in the night? When your children are under siege? When something unseen is choking your progress‚Äîyet you‚Äôve been praying, fasting, tithing, and nothing seems to shift?</p><p>That‚Äôs where the home altar comes in.</p><p>This book is a 28-chapter prophetic and practical journey to teach you:</p><ul><li><p><strong>How to build, dedicate, and protect your personal home altar</strong></p></li><li><p><strong>How to connect your home altar to your church altar for multiplied effect</strong></p></li><li><p><strong>How to activate divine protocols using oil, water, communion, prayer, and sacrifice</strong></p></li><li><p><strong>How to guard your altar from defilement and strange fire</strong></p></li><li><p><strong>How to release prophetic fire that speaks louder than any curse, witchcraft, or legal accusation</strong></p></li><li><p><strong>How to raise family altars that cover your children, restore marriages, and secure legacy</strong></p></li><li><p><strong>And ultimately, how to become a walking altar yourself‚Äîcarrying divine presence and power wherever you go</strong></p></li></ul><p>This is not just about setting up a sacred place‚Äîit‚Äôs about unlocking divine patterns and supernatural systems that govern victories, covenant, restoration, and legacy.</p><p>Throughout these 28 chapters, you‚Äôll also discover:</p><p>‚úÖ Hidden biblical secrets from Abraham, Elijah, David, and Jesus<br>‚úÖ Real-life testimonies of breakthrough and deliverance from believers around the world<br>‚úÖ Prophetic activations to anoint your home, break generational cycles, and recover stolen blessings<br>‚úÖ Step-by-step guides for cleansing, rededication, and aligning your altar with God‚Äôs timing</p><hr><h3><strong>Who Is This Book For?</strong></h3><p>This book is for the spiritual warrior who is tired of recycled battles.<br>It‚Äôs for the prayerful mother who wants to secure her children‚Äôs destiny.<br>It‚Äôs for the business owner who senses invisible resistance.<br>It‚Äôs for the prophetic intercessor, the pastor, the home leader, the frustrated believer who feels like something spiritual is ‚Äúoff‚Äù‚Äîand is finally ready to fix it.</p><hr><h3><strong>A Word from the Author</strong></h3><p>For over two decades, I‚Äôve seen firsthand how altars rule outcomes.<br>Some people‚Äôs lives are blocked because of evil altars in their bloodline. Others struggle because their altar at home is silent, defiled, or never existed. But when the right altar is raised and honored properly‚Äîmiracles happen. I‚Äôve seen barrenness end, marriages restored, finances explode, curses reversed, and demons silenced.</p><p>In&nbsp;<em>How to Build a Powerful Home Altar</em>, I‚Äôll walk you step-by-step through this sacred yet practical process. Whether you‚Äôre new to this or deeply seasoned, this book will equip you to experience God‚Äôs presence, power, and prophetic guidance like never before.</p><p>Are you ready to build an altar that speaks louder than any attack?</p><p>Then let‚Äôs begin.</p><p>‚Äî<br><strong>Dr. Climate Wiseman</strong></p>', '/uploads/1754454759109-pm9ru.png', '/uploads/pdfs/1754454747556-ejj37p.pdf', 5.00, 0, true, 'free', '2025-08-06 04:33:41.757605', '2025-08-06 04:33:41.757605', 'Discover powerful insights and practical strategies that will transform your personal and professional life. This comprehensive guide combines timeless wisdom with modern research to help you achieve lasting success and fulfillment.', 'A renowned author and thought leader in personal development, bringing decades of experience in helping individuals and organizations achieve their potential.', 'Premium Publishing', 2020, 250, 'English', NULL, 'Self-Help', '{Introduction,"Foundation Principles","Practical Applications","Advanced Strategies","Implementation Guide",Conclusion}', '{"Develop a growth mindset","Build consistent daily practices","Focus on long-term thinking","Create meaningful relationships"}', '{"Enhance personal effectiveness","Develop leadership skills","Improve decision-making abilities","Build lasting success habits"}', 'Intermediate', 4, '{self-help,personal-growth,success,motivation}', '{"Readers Choice Award","Personal Development Bestseller"}', 0, NULL, 5, NULL, NULL, NULL, 1048576, 0, NULL);
INSERT INTO public.books VALUES ('2c38e9b8-a06c-40fa-a055-f55ebaef7edc', 'Planted to Flourish: The Power of Being Rooted in God‚Äôs House', 'Dr C Wiseman', '<p><strong>Planted to Flourish: The Power of Being Rooted in God‚Äôs House</strong></p><p>What if you could live a life that feels anchored, secure, and overflowing with purpose? What if you could experience real belonging, deep growth, and unshakable peace?</p><p><strong>You can.</strong></p><p><strong>Planted to Flourish</strong>&nbsp;is your invitation to discover the joy and strength that comes from being truly rooted in God‚Äôs house. This isn‚Äôt just about attending church‚Äîit‚Äôs about finding your spiritual family, growing deep roots of faith, and living the abundant life God designed for you.</p><p>Inside these pages, you‚Äôll uncover:</p><ul><li><p>The beauty and power of spiritual commitment.</p></li><li><p>How to cultivate unbreakable unity and authentic community.</p></li><li><p>Practical steps to heal from past hurts and embrace lasting connection.</p></li><li><p>Inspiring prayers and prophetic declarations to seal your covenant with God.</p></li><li><p>A clear path to receive&nbsp;<strong>Divine Direction, Divine Connection, Divine Provision, and Divine Protection.</strong></p></li></ul><p><strong>This book is for you if you:</strong></p><ul><li><p>Long to find your place and purpose in God‚Äôs family.</p></li><li><p>Want to deepen your faith and bear lasting fruit.</p></li><li><p>Desire strong, healthy relationships built on love and trust.</p></li><li><p>Feel called to strengthen your church and transform your community.</p></li><li><p>Dream of leaving a spiritual legacy that impacts generations.</p></li></ul><p><strong>Planted to Flourish</strong>&nbsp;offers you more than insight‚Äîit offers you transformation. It‚Äôs a guide to stepping into the life God has promised: a life of stability, fruitfulness, and profound joy.</p><p><strong>You were created to be planted. You were destined to flourish.</strong></p><p><strong>Your journey to a deeply rooted, thriving life begins here. Are you ready to embrace it?</strong></p>', '/uploads/1754454964404-hyn8.png', '/uploads/pdfs/1754454880444-jt4n8q.pdf', 5.00, 0, true, 'free', '2025-08-06 04:36:39.857776', '2025-08-06 04:36:39.857776', 'Discover powerful insights and practical strategies that will transform your personal and professional life. This comprehensive guide combines timeless wisdom with modern research to help you achieve lasting success and fulfillment.', 'A renowned author and thought leader in personal development, bringing decades of experience in helping individuals and organizations achieve their potential.', 'Premium Publishing', 2020, 250, 'English', NULL, 'Self-Help', '{Introduction,"Foundation Principles","Practical Applications","Advanced Strategies","Implementation Guide",Conclusion}', '{"Develop a growth mindset","Build consistent daily practices","Focus on long-term thinking","Create meaningful relationships"}', '{"Enhance personal effectiveness","Develop leadership skills","Improve decision-making abilities","Build lasting success habits"}', 'Intermediate', 4, '{self-help,personal-growth,success,motivation}', '{"Readers Choice Award","Personal Development Bestseller"}', 0, NULL, 5, NULL, NULL, NULL, 1048576, 0, NULL);
INSERT INTO public.books VALUES ('25eade19-d8ab-4c25-b9e9-7f2fc63d6808', '30 Days To Develop A Spirit Of Excellence: Your Step By Step Guide To Mastering Character, Competence, and Calling in the Professional World', 'Dr C Wiseman', '<p><strong>30 Days to a Spirit of Excellence: Mastering Character, Competence, and Calling in the Professional World</strong></p><p>Are you tired of doing your best and still feeling overlooked, misunderstood, or stuck?<br>Do you know you were made for more‚Äîbut can‚Äôt seem to break through?</p><p>In a world driven by speed, status, and shortcuts,&nbsp;<em>excellence</em>&nbsp;often gets buried under exhaustion. You want to stand out‚Äîbut without selling out. You want to rise‚Äîbut without losing yourself. You want to fulfill your calling‚Äîbut without compromising your character.</p><p>This is the book that bridges the gap.</p><p><strong><em>30 Days to a Spirit of Excellence</em></strong>&nbsp;is a transformational journey that will recalibrate your mindset, refine your habits, and reignite your passion to lead with integrity, perform with mastery, and walk boldly in your divine assignment.</p><p>With 30 days of daily wisdom, prophetic strategies, reflective prompts, and real-life breakthroughs, you‚Äôll learn how to:</p><p>‚úÖ Develop unshakable character in hostile environments<br>‚úÖ Master professional competence without burnout<br>‚úÖ Maintain your values while climbing higher<br>‚úÖ Create influence without arrogance<br>‚úÖ Recover your joy, clarity, and inner strength<br>‚úÖ Rise without retaliation, compromise, or fear</p><p>This isn‚Äôt just another motivational book.<br>It‚Äôs a spiritual roadmap to&nbsp;<em>becoming the person your purpose has been waiting for.</em></p><p><strong>This book is for you if:</strong></p><ul><li><p>You‚Äôre a professional struggling to balance ambition with authenticity</p></li><li><p>You‚Äôre called to leadership but feel spiritually unprepared</p></li><li><p>You‚Äôre tired of mediocrity and ready to stand out with integrity</p></li><li><p>You want to build a legacy without losing your soul</p></li><li><p>You believe God has more for you‚Äîbut need the blueprint to walk it out</p></li></ul><p>Written with deep compassion, prophetic insight, and practical steps,&nbsp;<em>30 Days to a Spirit of Excellence</em>&nbsp;will help you rise‚Äîone day, one habit, and one victory at a time.</p><p><strong>The clarity, confidence, and calling you‚Äôve been searching for is just 30 days away. Are you ready to embrace it?</strong></p>', '/uploads/1754456325388-e4zopo.png', '/uploads/pdfs/1754456339085-vev1pj.pdf', 5.00, 0, true, 'free', '2025-08-06 04:59:37.649894', '2025-08-06 04:59:37.649894', 'Discover powerful insights and practical strategies that will transform your personal and professional life. This comprehensive guide combines timeless wisdom with modern research to help you achieve lasting success and fulfillment.', 'A renowned author and thought leader in personal development, bringing decades of experience in helping individuals and organizations achieve their potential.', 'Premium Publishing', 2020, 250, 'English', NULL, 'Self-Help', '{Introduction,"Foundation Principles","Practical Applications","Advanced Strategies","Implementation Guide",Conclusion}', '{"Develop a growth mindset","Build consistent daily practices","Focus on long-term thinking","Create meaningful relationships"}', '{"Enhance personal effectiveness","Develop leadership skills","Improve decision-making abilities","Build lasting success habits"}', 'Intermediate', 4, '{self-help,personal-growth,success,motivation}', '{"Readers Choice Award","Personal Development Bestseller"}', 0, NULL, 5, NULL, NULL, NULL, 1048576, 0, NULL);
