INSERT INTO public.book_reviews VALUES ('review_sample_001', '45814604', '39a430b3-9bfd-4d3d-a848-2b450f4cfe13', 5, 'Powerful insights on biblical wealth principles', 'Dr. Wiseman provides a comprehensive and practical approach to understanding God''s economy. This book helped me completely reframe my relationship with money and giving. The biblical foundations are solid, and the practical applications are immediately actionable.', true, 8, true, '2025-08-08 11:43:16.287084', '2025-08-08 11:43:16.287084');
INSERT INTO public.book_reviews VALUES ('review_sample_002', '45814604', 'b9ad5b9d-2437-4ed8-be2b-6bb517ecd1aa', 4, 'Essential for leadership development', 'An excellent resource for anyone serious about multiplying their impact through others. The practical steps for equipping leaders are clear and biblically grounded. I''ve already started implementing these principles in my ministry.', true, 5, true, '2025-08-08 11:43:16.287084', '2025-08-08 11:43:16.287084');
INSERT INTO public.book_reviews VALUES ('review_sample_003', '45814604', 'ec226b44-4cd1-4e95-a21b-f3ae2f934cd3', 5, 'Finally broke through my "almost there" pattern!', 'This book was exactly what I needed. I had been stuck in near-success for years, and Dr. Wiseman''s 30-day guide provided the breakthrough strategies I needed. The daily exercises are practical and powerful.', true, 12, true, '2025-08-08 11:43:16.287084', '2025-08-08 11:43:16.287084');
INSERT INTO public.reading_challenges VALUES ('146362a4-705f-49ff-b858-4d01d713b952', '30 days ', 'Thank you so much and I Pray My God shall Open Unto You His Good Treasure The Heavens And Send Forth Blessings, Favours, health, Wealth and Money Into Your Life. God will bless you, From Prophet Climate ', 'books_count', 5, 'monthly', '2025-08-08 00:00:00', '2025-09-07 00:00:00', true, true, 'manual_1754457852879_osie0x', NULL, '{}', '{}', 'medium', NULL, '2025-08-08 02:19:50.553629', '2025-08-08 02:19:50.553629');
